import React, { setState } from "react";
import "./VideoPlayer.css";
import "../Metronome/Metronome";

const VideoPlayer = ({ isPlaying }) => {

    const exampleVideo = "Djrl6fu8myo";
    isPlaying = 0;


    return (
        <div>
            <VideoPlayer />
            <div id="VideoControls">
                <iframe width="960" height="540" controls="0" src={"https://www.youtube.com/embed/" + exampleVideo + `?autoplay=${isPlaying}&showinfo=0&controls=0&rel=0`}></iframe>
                <button id="PlayButton" className="text"></button>
            </div>
        </div>
    )
}

export default VideoPlayer;
